export const defaultState = {
    forecastData: null,
    forecastRes: null
}

export const reducer = (state = defaultState, action) => {
    switch (action.type) {
      case 'SET_OBJECT':
        return {
          ...state,
          forecastData: action.payload,
          forecastRes: action.payload
        }
      default:
        return state
    }
  }
